	("Ao entrar em uma sala de aula do curso de Psicologia o maior n√∫mero de estudantes √© de mulheres. 
	Mas nem sempre foi assim. Quando a psicologia moderna surgiu como ci√™ncia no s√©culo XIX, as mulheres em 
	geral n√£o podiam estudar. No entanto, algumas delas n√£o aceitaram as barreiras sociais, para a nossa felicidade, 
	e come√ßaram a lutar pelo direito ao estudo.<br> Claro que n√£o era somente no campo da psicologia que isso 
	acontecia, pois para os homens da √©poca, as mulheres n√£o possu√≠am capacidade intelectual. Com o tempo 
	isso foi mudando, espa√ßos foram conquistados, a capacidade foi provada. No entanto, ainda hoje quase n√£o 
	temos contato com escritos e teorias realizados por mulheres, ne mesmo tomamos conhecimento da hist√≥ria delas.<br>
	Mulheres como Christine Ladd Franklin, Leta Stetter Hollingwort, Melanie Klein, Dorothea Dix, Anna Freud, e 
	muitas outras contribu√≠ram para estudos e pesquisas na psicologia. Cada uma merece um olhar mais profundo em 
	seus trabalhos, para entendermos a import√¢ncia delas na historia da nossa profiss√£o.<br> N√£o √© o caso de diminuir a 
	import√¢ncia dos trabalhos realizados pelos homens, mas acreditamos que a desigualdade na rela√ß√£o do homem e mulher 
	tem que come√ßar a ser dissipada tamb√©m no campo intelectual. Queremos ter a chance de conhecer e estudar essas mulheres, 
	n√£o apenas em textos isolados ou por que elas foram casadas e ajudaram no pensamento de uma teoria, e sim por que elas 
	contribu√≠ram e a ainda contribuem fortemente para a constru√ß√£o da psicologia como profiss√£o.<br> A impress√£o que temos 
	√© que somos muitas e ainda sim muito poucas. Pouco ouvidas, lidas e compreendidas. Ainda n√£o temos nosso lugar nas 
	academias como os homens. E se quisermos um mundo mais igualit√°rio devemos come√ßar pela maneira como pensamos. 
	Portanto, acreditamos que devemos ter mais contato com literaturas como a de Simone de Beauvoir, Nise da Silveira, 
	Laura Perls e outras tantas que deixaram a sua marca na hist√≥ria da psicologia e do mundo."
