	j√° tinha gente que se sentava nessas cadeiras que at√© ent√£o eram ‚Äònossas‚Äô, mas mesmo assim a gente insistiu em sentar no nosso 
	lugar de costume. Nem preciso falar que deu ruim, n√©?‚Äù completa a aluna.<br> A piora de conviv√™ncia acirrou alguns √¢nimos, 
	mas sobretudo trouxe √† tona a discuss√£o sobre a marca√ß√£o de lugares. Certamente, ter ao redor pessoas com as quais se 
	tem alguma identifica√ß√£o torna a experi√™ncia da faculdade mais agrad√°vel. O problema est√° quando novas pessoas entram no 
